def isPalindrome(s):
    l = s[0:len(s) // 2]
    r = s[len(s) // 2 if len(s) % 2 == 0 else ((len(s) // 2) + 1):]
    r = r[::-1]
    return l == r


def shortestPalindrome(s):
    """
    :type s: str
    :rtype: str
    """
    '''res_first = test_str[0:len(test_str)//2]
    res_second = test_str[len(test_str)//2 if len(test_str)%2 == 0
                             else ((len(test_str)//2)+1):]'''
    if len(s) == 0 or len(s) == 1:
        return s
    if s.count(s[0]) == len(s):
        return s
    i = -1
    ins = 0
    #print(s[:0])

    while not isPalindrome(s):
        s = s[:ins] + s[i] + s[ins:]
        i += -1
        ins += 1
    return s

s1 = "aacecaaa"
s2 = "abcd"
s3 = ""

print(shortestPalindrome(s1))
print(shortestPalindrome(s2))
print(shortestPalindrome(s3))